import React from "react";
import { Link } from "react-router-dom";
import Nav from "./nav";

const Header = () => {
    return (
        <header>
            <Link to="/">
                <img src="./assets/logo.png" alt="logo" />
            </Link>
            <Nav />
        </header>
    );
};

export default Header;
